INSERT INTO `onl_cgform_enhance_js` VALUES ('c5ac9a2b2fd92ef68274f630b8aec78a', 'tjbpm(row){\n  alert(\'提交流程\')\n  console.log(\'row\',row)\n}\n\nbt1(){\n   console.log(\'that.table.selectionRows\',that.table.selectionRows)\n   console.log(\'that.table.selectedRowKeys\',that.table.selectedRowKeys)\n   console.log(\'that.table.dataSource\',that.table.dataSource)\n   alert(\'激活全部数据\')\n}', 'list', NULL, '05a3a30dada7411c9109306aa4117068');
INSERT INTO `onl_cgform_enhance_js` VALUES ('c799671682b77ac47d179bbe29f70b6e', 'show(){\n  if(globalThis.pageType==\'add\'){\n     var url = \'/sys/fillRule/executeRuleByCode/\'\n		 var ruleCode = \'flow_number\'\n  	 var formData = {\n  				lastCode: globalThis.lastCode,\n  				firstNo: \'C099\',\n   				numberLength: 3\n  	 }\n		 postAction(url + ruleCode, formData).then(res => {\n  			if (res.success) {\n    			var value = res.result\n     		  that.triggleChangeValue(\'code\', value)\n  			}\n		})\n  }\n}\nafterAdd(){\n  globalThis.getLastCode()\n}\nonlChange(){\n  return {\n    table_type(){\n      let value = event.value\n      let tableOptions = []\n      if(value&&value!=\'\'){\n        getAction(\'/online/cgform/head/list\', {\n          pageNo: 1,\n          pageSize: 99,\n          copyType: 0,\n          formCategory: value\n        }).then(res => {\n          that.triggleChangeValue(\'table_name\',\'\')\n          tableOptions = res.result.records.map(m=>({value:m.tableName,text:m.tableTxt}))\n          that.changeOptions(\'table_name\',tableOptions)\n        })\n      }\n    }\n    type(){\n      let value = event.value\n      if(value==\'2\'){ //系统表单,样式默认not\n        that.triggleChangeValue(\'style\',\'not\')\n      }\n    }\n  }\n}', 'form', NULL, '746a8e969df74571936b094b1590c4d3');
