INSERT INTO `onl_cgform_enhance_js` VALUES ('eca5c9412777bb00e51a7e6e61db5081', 'created(){\n  globalThis.getLastCode = ()=>{\n    let url = \'/online/cgform/api/getData/746a8e969df74571936b094b1590c4d3\'\n  	let params = {\n    column: \'code\',\n    order: \'desc\',\n    pageNo: 1,\n    pageSize: 1\n  	}\n  	getAction(url,params).then(res=>{\n    let r = res.result.records[0]\n    if(r){\n      globalThis.lastCode = r.code\n    }\n  	})\n  }\n  globalThis.getLastCode()\n}\nbeforeAdd(){\n  globalThis.pageType = \'add\'\n}\nbeforeEdit(){\n  globalThis.pageType = \'edit\'\n}\nbeforeDelete(){\n  globalThis.pageType = \'delete\'\n}\nafterAdd(){\n  globalThis.getLastCode()\n}', 'list', NULL, '746a8e969df74571936b094b1590c4d3');
